import React, { Component } from "react";

export class DataTable extends Component {
  render() {
    let data;
    if (this.props.data) {
      if (this.props.query === "") {
        data = this.props.data;
      } else {
        data = this.props.data.filter(person => {
          return Object.values(person)
            .toLowerCase()
            .includes(this.props.query.toLowerCase());
        });
      }
    }

    // let query = this.props.query;
    // let personalData = this.props.data;
    // let filtered = personalData.filter(person => {});
    // if (personalData) {
    //   if (query.length > 0) {
    //   }
    // } else {
    //   return <div></div>;
    // }

    let personalData = this.props.data;
    if (!personalData) {
      return <div></div>;
    } else {
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Age</th>
              <th>Eye color</th>
              <th>Gender</th>
              <th>Company</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Address</th>
            </tr>
          </thead>
          <tbody>
            {personalData.map(person => {
              return (
                <tr key={person._id}>
                  <td>{person.name}</td>
                  <td>{person.age}</td>
                  <td>{person.eyeColor}</td>
                  <td>{person.gender}</td>
                  <td>{person.company}</td>
                  <td>{person.email}</td>
                  <td>{person.phone}</td>
                  <td>{person.address}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      );
    }
  }
}

export default DataTable;
